import React from 'react'
import {Card} from 'antd'

export const ResultCard = (props) => {
    return(
        <Card className="card" 
        hoverable={true} 
        size='small'
        cover={<img id='card-img'src={props.result.image}/>} 
        onClick={() => props.onSelectChange(props.result.id)}
        >
            <div className="card-body">
                <h4 className="food-title">{props.result.title}</h4>
            </div>
        </Card> 
    )
}
